import React, { useEffect, useState } from 'react';
import api from '../../api'; // Assuming this path is correct for your axios instance

export default function AdminPanel() {
  const [users, setUsers] = useState([]);
  const [error, setError] = useState('');
  const [message, setMessage] = useState(''); // New state for success/error messages

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      setError('No authorization token found. Please log in as an admin.');
      return;
    }

    // Corrected Authorization header syntax
    api.get('/api/admin/users', {
      headers: { Authorization: `Bearer ${token}` },
    })
      .then((res) => {
        console.log('Users loaded:', res.data);
        setUsers(res.data);
        setError(''); // Clear any previous error
      })
      .catch((err) => {
        console.error('Admin fetch error:', err.response?.data || err.message);
        setError(err.response?.data?.msg || 'Failed to load users. Unauthorized access or server error.');
        setUsers([]); // Clear users on error
      });
  }, []);

  const toggleBlock = async (id) => {
    const token = localStorage.getItem('token');
    if (!token) {
      setMessage('Authentication token missing. Cannot perform action.');
      return;
    }

    try {
      // Corrected Authorization header syntax
      await api.patch(`/api/admin/users/${id}/toggle`, {}, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setUsers(users.map(u =>
        u._id === id ? { ...u, isBlocked: !u.isBlocked } : u
      ));
      setMessage(`User status updated successfully for ID: ${id}`); // Success message
      setError(''); // Clear any previous error
    } catch (err) {
      console.error('Error toggling user status:', err.response?.data || err.message);
      setMessage(err.response?.data?.msg || 'Error toggling user status.'); // Specific error message
      setError(''); // Clear general error on action-specific error
    }
    // Clear message after some time
    setTimeout(() => setMessage(''), 3000);
  };

  return (
    <div className="container mt-4">
      <h2>Admin Panel</h2>
      {error && <p className="text-danger text-red-600 bg-red-100 p-2 rounded-md">{error}</p>}
      {message && <p className="text-success text-green-600 bg-green-100 p-2 rounded-md">{message}</p>}
      
      {users.length === 0 && !error && !message ? ( // Check for loading state or no users
        <p>Loading users, or no users found yet.</p>
      ) : (
        <table className="table table-bordered mt-3 w-full border-collapse"> {/* Added w-full border-collapse for basic table styling */}
          <thead>
            <tr className="bg-gray-200">
              <th className="p-2 border border-gray-300 text-left">Name</th>
              <th className="p-2 border border-gray-300 text-left">Email</th>
              <th className="p-2 border border-gray-300 text-left">Role</th>
              <th className="p-2 border border-gray-300 text-left">Status</th>
              <th className="p-2 border border-gray-300 text-left">Action</th>
            </tr>
          </thead>
          <tbody>
            {users.map((u) => (
              <tr key={u._id} className="hover:bg-gray-50">
                <td className="p-2 border border-gray-300">{u.name}</td>
                <td className="p-2 border border-gray-300">{u.email}</td>
                <td className="p-2 border border-gray-300">{u.role}</td>
                <td className="p-2 border border-gray-300">{u.isBlocked ? 'Blocked' : 'Active'}</td>
                <td className="p-2 border border-gray-300">
                  <button
                    onClick={() => toggleBlock(u._id)}
                    // Assuming Bootstrap classes, otherwise these are just text.
                    // For a full app, consider adding Tailwind/custom classes.
                    className={`btn btn-sm ${u.isBlocked ? 'btn-success bg-green-500 text-white p-2 rounded-md hover:bg-green-600' : 'btn-danger bg-red-500 text-white p-2 rounded-md hover:bg-red-600'} transition-colors duration-200`}
                  >
                    {u.isBlocked ? 'Unblock' : 'Block'}
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}
